  // La fonction qui ajoute un lien de suppression d'une catgorie
  function addDeleteLink($prototype) {
    // Cration du lien
    var $deleteLink = $('<a href="#" class="btn btn-danger btn-sm">Supprimer</a>');

    // Ajout du lien
    $prototype.append($deleteLink);

    // Ajout du listener sur le clic du lien pour effectivement supprimer la catgorie
    $deleteLink.click(function (e) {
      if (confirm('Etes vous certain de vouloir supprimer cette entre ?')) {
        $prototype.remove();
        e.preventDefault(); // vite qu'un # apparaisse dans l'URL
      }
      
      return false;
    });
  }


